    function date_to_string($date){
        $month=['Janvier', 'Février', 'Mars', 'Avril', 'Mai', 'Juin', 'Juillet', 'Aout', 'Septembre', 'Octobre', 'Novembre', 'Décembre'];
        $detail=explode("-", $date);
        $m=$month[intval($detail[1]) -1];
        $string="$detail[2] $m $detail[0]";
        return($string);
    }

